import React, { useState, useEffect } from "react";

const App = () => {


  const memoryCards = ['apple', 'banana', 'orange', 'kiwi', 'pear']
  const displayedOrders = []

  const StoreDisplayOrder = (recursions) => { 
    let newDisplayOrder = []
    if(displayedOrders.length === recursions){return displayedOrders}

    for(let i = 0; i < 5; i++) {
      newDisplayOrder.push(Number.parseInt(Math.random() * 5)) // no repetition in seq. allowed, fix this after this line
    }
    if(displayedOrders[0] === undefined) {
      displayedOrders.push(newDisplayOrder)
      return StoreDisplayOrder(recursions)
    }
    for(const i in displayedOrders) {
      if(displayedOrders[i] === newDisplayOrder) {
        return StoreDisplayOrder
      } else {
        displayedOrders.push(newDisplayOrder)
        return StoreDisplayOrder
      }
    }
  }

  StoreDisplayOrder(5)
  console.log(displayedOrders)

  return (
    <div>
      {displayedOrders}
    </div>
  )
};

export default App;
